Mock.mock("/goodsList","post",options => {
  let transfer_word = JSON.parse(options.body).keyword
  let transfer_sort = JSON.parse(options.body).sort

  let newArray = [...goodsList_iphone.result.data]
  if(transfer_word === "手机"){

    if(transfer_sort === 1){
      goodsList_iphone.result.data.sort((a,b) => {
        return a.salePrice-b.salePrice;
      })

    }else if(transfer_sort === -1){
      goodsList_iphone.result.data.sort((a,b) => {
        return -(a.salePrice - b.salePrice)
      })

    }

    return goodsList_iphone

  }else if(transfer_word === "数码相机"){
    return goodsList_camera
  }else{
    return {
      status: "0",
      msg: "error",
      result: {
        count: 0,
      }
    }
  }
})


